            // f1("השקפה נכונה, רחוק מהזמן ומהסערה, על אירועים דרמטיים בחיינו יכולה לחשוף אותם לאור חדש ולגלות מה באמת היה שם.\r\nמחלה עונתית ויראלית מאמללת מאוד אך נטולת סכנה עוברת עליי. הלילה רותח ונחילי זיעה ניגרים מראשי אל הכרית ומעוררים בי חשש שמשהו זוחל עליי. שום דבר. זוהי רק זיעתי שלי.\r\nמה בתוך הלילה מעורפל החושים והמיוזע הזה לוקח אותי אחורה לשירות הצבאי שלי, לא אדע בדיוק. משהו שקשור לשאלה, איפה הכוח שלי? אולי אם אזהה אותו אתחיל להחלים?\r\nממתי אני מכירה את הכוח שלי? האם היה לי כוח? קול? כשהייתי בת  לחלוטין לא מוכנה בשום צורה שהיא לגיוס? שנים רבות אחרי, וגם השנה, נהגתי לומר שמי שהכיר אותי בתקופת השירות הצבאי בטח לא חשב שיצא ממני משהו. כל כך עלובה וחסרת ערך חשתי אז. ודווקא עכשיו, בערפול חושים מוחלט, כשהמנטליות הוא ביצה אחת גדולה של אסוציאציות, מחשבות וזיכרונות, מתוך מקום לא צלול בעליל, עולה בי השאלה: האם זו אמירה נכונה? האם היא צודקת? ולמה אני ממשיכה לומר אותה? מה בכל זאת היה בי גם אז?\r\nמהיום שנולדתי הבטיחו לי שוב ושוב, עוד לפני שהבנתי את המילים, שעד שאני אהיה בת יהיה שלום בעולם ולא יצטרכו עוד צבא. והאמנתי. הצבא, מבחינתו, ברמות התכנון והאסטרטגיה, ניסה לכוון אותי. הציעו קורס קדם צבאי, הציעו קורס קצינים. בת שהייתי דחתה את האפשרויות מכול וכול. הייתה זו סוג של אטימות שחיפתה על ייאוש תהומי מכך שאני נדחקת כבורג למכונה, בדיוק כאשר התחלתי לעמוד על דעתי ולהכיר את עצמי.\r\nלא הייתה בי אגוצנטריות. מאחוריי היו שנים מלאות של מסירות אינסופית יומיומית לילדים בבית ילדים, שבהם טיפלתי ואותם אהבתי ממש כאילו היו שלי. לו הציעו לי אז שירות לאומי כלשהו ייתכן שהייתי תורמת ונתרמת, אך עמדו בפניי שתי אפשרויות שהכרתי אז – להתחתן עם החבר שלי, שהוא בן זוגי עד היום, או להצהיר שאני דתייה. בת שהייתי דחתה גם את האפשרויות האלה מכול וכול. שתיהן נתפסו בעיניי כשקר, ושקר לא בא בחשבון, לא אז ולא היום. הנה מקור אחד של כוח – הידיעה שגם אם נתחתן בעתיד, זה לא יקרה עכשיו רק כדי להתחמק ממשהו, וגם אם אני מסורתית בליבי לא אקצין זאת עכשיו כדי להשיג מעמד שקרי.\r\nבעוד אני מתהפכת על משכבי בייסורים בני חלוף, חשבתי לעצמי חודשים של שירות בסך הכול… ומה לא היה בהם?! מה זה היה המסע הזה?! מכבש אימתני שמעך אותי כדי שאיכנע, שאשתטח, שאתאים לסטנדרט, ולא נכנעתי. ואולי היה זה מכבש אימתני שעבר מעליי, אילץ את קליפתי להתבקע וסייע לי להכיר את מקומי ואת ערכי בעולם? מתוך הביצה המנטלית, בלילה הרותח הזה, אני בוחרת לראשונה באפשרות השנייה.\r\nהטירונות הייתה נהדרת, באמת. הייתי אתלטית מאוד ובכושר טוב, באתי מבית פרטני למדי. היום שבו עבדתי לראשונה במטבח וניסיתי לברור עגבניות לשקשוקה היה סוג של שוק, כי אחרי המאמץ לברור את הראויות, בא מישהו מעליי והתעצבן. מי ביקש ממך לברור? הכול נכנס פנימה….או-קי, שוק, אבל לא נורא. שמרתי על רוח טובה ונמנעתי מאכילת שקשוקה. הסתגלות כזו יכולתי לפתח.\r\nבאותה תקופה איתרו במיוחד  לבסיס הטירונות. זה היה הצורך. כל מי שהייתה בסדר נאלצה להתמיין בריאיון אישי אצל מפקדת הבסיס, שדמותה הטילה אימה על כולנו. היא הייתה מעין טנק מצוות מהודר, מאוחדת כל כולה עם התפקיד. כך לפחות זה נתפס בעיני טירונית בלתי מאוחדת עם התפקיד, כמוני. הבנות התפתלו ועשו הכול כדי להתחמק. אף אחת לא רצתה להיתקע כבר בשלב הראשון לכל תקופת השירות. הפעילו קשרים (לי לא היו), איימו לברוח, להתאבד (אני לא יכולתי לשקר). ישבנו בטור מחוץ לצריף שלה, משקשקות, ואחת אחת הן יצאו מהריאיון בוכות.\r\nכשהגיע תורי ישבתי על כיסא לא קדמי, שלא יחשדו בי במנהיגות, חלילה, אבל לא הייתה לי אסטרטגיה. חשתי בתוכי פנימה רק דחייה מוחלטת ואטימות. יש לך ניסיון בהדרכה? אולי בצופים? לא, השבתי, מכנסת עמוק אל תוך ליבי את שלוש השנים בבית הילדים שבמהלכן הייתי לילדים מטפלת, מדריכה, מורת שיעורי עזר, פולט כינים, מפזרת הפגנות, משכינת שלום, אם ואחות. הדרכה בצופים לא הייתה, לא בצופים ולא בשום תנועת נוער אחרת. \r\nאת רוצה ללכת לקורס  היא שאלה. לא, השבתי. ואם בכל זאת תישלחי? שאלה המפקדת ונימת לעג התגנבה לקולה, מה תעשי? תברחי? לא, השבתי. אז מה תעשי? אם בכל זאת יבחרו בך, מה תעשי? לא היה לי את זה מוכן מראש, אך באותו רגע ידעתי, אני פשוט לא אצליח. מה זה אומר? היא הקשתה, מנסה לאתר רוח של מרד. שום דבר, אמרתי, אני פשוט לא אעשה את הכי טוב שאני יכולה כדי להצליח. שקט השתרר. היא התבוננה בי והריאיון הסתיים. יצאתי, לא בוכה. הלכתי לאולם השינה, נשכבתי על המיטה ועצמתי עיניים. שקט פנימי הציף אותי. ראיתי חיזיון מדהים של דפי נייר, מסמכים, יורדים בעדינות כמו נוצות מהתקרה, ונכנסים כל אחד למקומותיהם על מדפים. היה לי קול. והוא נשמע. ניצחתי.\r\nהאם מכאן הלכו הדברים והידרדרו? או שרמת המבחן של החיים עלתה?\r\nשלוש האפשרויות שביקשתי לשיבוץ נדחו, ומצאתי את עצמי כפקידה באחד החילות שהיה מבוסס בקריה. מה שנראה היום כמו אתר תיירותי היה גיבוב של צריפים מתפוררים, שורצי זוחלים ומכרסמים שחיבר בין מבני האבן היפים. מרגע הכניסה ועד רגע היציאה לא נראו פני השמיים. אור יום לא חדר פנימה, אלא מהחלונות הצרים החיצוניים של אותם פחונים וצריפים. כשאני בודקת עם עצמי עד כמה אני מגזימה, אני לא מוצאת אפשרות לתאר את זה אחרת. חייל שביקש לאכול צוהריים בבסיס הקריה באותה שנה נדרש לקבל חיסון נגד צהבת. נתון זה הרחיב את תמונת השקשוקה ונתן לה כותרת – זיהום. בכל בוקר כשהגעתי לפתוח את המשרד סובבתי בעדינות את המפתח במנעול, הורדתי את הידית כדי שהדלת תהיה משוחררת, התרחקתי ובעטתי בדלת בעוצמה. באור הקלוש שחדר מן החלון החיצוני קיפצו בבהלה עכברים גדולים למדי שמיהרו להימלט.\r\nמהבחינה האנושית זה היה מורכב אפילו יותר.\r\nשלצידו עבדתי אמר בטלפון, יותר מפעם אחת – כנראה הפקידה המטומטמת שלי לא עשתה את זה… התבוננתי סביבי בתדהמה. לא היה איש חוץ משנינו בחדר, ועדיין לא יכולתי להאמין שכך הוא מדבר עליי! נתתי בו מבט שאומר, שמעתי את זה! והוא החזיר לי מבט מזלזל, מלמעלה למטה.\r\nענק ממדים במשרד הסמוך שנהג להושיב את המזכירה שלו על ירכו, שאג אליי יום אחד מהפרוזדור, בואי הנה! מה קרה? שאלתי מפתח המשרד. בואי הנה, אני צריך משהו, המזכירה שלי לא כאן היום. דבר, אני שומעת מכאן, השבתי, והוא פרץ בצחוק נבוך. בואי, שבי כאן, אמר בחיוך נאלח והצביע על ירכו. לא! אמרתי לו והלכתי. בואי הנה, אמרתי! הוא שאג מרחוק, והמשכתי ללכת. \r\nביום אחר ראה אותי רצה בפרוזדור בעודו צועד לקראתי. הוא הושיט יד, תפס אותי במעיל והרים אותי מעל הקרקע כך שפניי היו מול פניו. לא רצים בפרוזדור, סינן בשקט, ושחרר.\r\nהגיעה השעה לתורנות לילה ראשונה, שפירושה לקחת מזרן רווי מחדר מעופש, להניח אותו על השולחן במשרדי, ולקוות שזוחלים ומכרסמים לא יעלו עליי. זה כשלעצמו מצב שלא יכולתי לעכל. אך החיים לא הותירו הרבה זמן להתלבטות.\r\nאמי נפצעה קשה בפיגוע חבלני, הראשון שהתרחש בשוק הכרמל. היא הייתה מאושפזת באיכילוב עם פגיעה רב מערכתית. ניגשתי אל כדי לבקש שחרור מהתורנות ונימקתי מדוע. את נשארת, קבע. תלכי לבקר את אמא שלך מחר. באותו רגע נכנסה, פקידה אחרת, מאופרת כנמרה. שלמה, חנחנה, אני לא נשארת לתורנות. יש לי חתונה בכרם. לכי, כפרה, לכי, השיב לה בחיוך. בפניי בעודי באותו חדר. \r\nהיה פה אי צדק שלא יכולתי להשלים איתו. התעורר בי זעם. וזעם, לאדם שלו כמוני זה מפחיד עד מוות מצד אחד, ומצד שני הכרחי לפעמים כדי לעורר את כוחות החיים. אני לא אישאר כאן הלילה, החלטתי. לא אישאר ויהי מה! אבל, איך אצא מכאן?\r\nעברתי במבוך וחיפשתי מוצא. מצאתי חצר אחורית עם גדר גבוהה מאוד. הייתי אתלטית מאוד. יכולתי במאמץ גדול לטפס עליה ולעבור אותה, אבל אם איתפס בעודי למעלה, מה אומר? איך אצדיק את מה שאני עושה שם? פסלתי. נותר רק פתח אחד שהכרתי, והוא הכניסה. איך אעבור בה?\r\nחיכיתי לשעת לילה, אחרי שהלכו כולם. נעלתי את המשרד, יישרתי את הירכית, מתחתי את קומתי ובלב הולם אך בצעדים שקולים עברתי על פני לילה טוב, אמרתי לו, נתראה מחר. והוא פתח לי.\r\nהיו לצידי מלאכים ששמרו עליי באותם ימים קשים. שלושה חיילים ששירתו בחדרים סמוכים. אחד גבוה במיוחד, שני נמוך במיוחד, ואחד בגובה רגיל, עם עיניים ירוקות טובות, שהיה רב מלאך. \r\nהרגעים שאכלנו גלידה ארבעתנו, שאפנו מקטרת עם טבק בטעמים ודיברנו על מיסטיקה היו רגעי חסד. והקצינה שלי  שאמרה לי מהרגע הראשון, אני לא אבקש ממך אף פעם להכין לי קפה. אם את מכינה לעצמך אשמח שתשאלי אותי אם אני גם רוצה. ואם אני אכין לעצמי, אכין גם לך. אותה אישה מיוחדת הפקידה את סודותיה אצל והוא פיזר אותם ברוח… לכל עבר. ביזה אותה, לעג לה.\r\nאמי נכנסה לשיקום ממושך בבית ואני ביקשתי שחרור מוקדם, וקיבלתי.\r\nביום האחרון הזמנתי את הקצינה שלי לקפה מחוץ למשרד. התעקשתי על כך. הודיתי לה על יחסה ההוגן כלפיי. ליבי פעם בחוזקה, אבל סיפרתי לה כל מה שאני יודעת עליה, ממנו, שהיא נותנת בו אמון. היא הזילה דמעה והודתה לי על כך. צדק יראה אור.\r\nמתוך מחלה עונתית ויראלית, מאמללת ונטולת סכנה, אני חוזרת אל בת שהייתי ומבקשת את סליחתה. היא לא הייתה לא כלום לא נוצה ברוח וכן, היה לה כוח, גם אז. שקר גס – לא, אמת חלקית – אם צריך, לא להשלים לעולם עם אי צדק ולא להיות חלק ממנו, במקום שנראה כי אין מעבר, למצוא אותו.\r\nהבוקר מאיר, חם ומיוזע, אבל לא איבדתי את הלילה. לעיתים נחוץ לעבור בערפל של ביצה מנטלית כדי לראות בבהירות את הדברים מחדש\r\nאני שואל: לאכול לשם מה? אני שואל לחיות לשם מה? לא די לחיות. הרי כולם יודעים שבחיי היחיד לא די בזה. היחיד יודע שצריך לחיות לשם ולא סתם לחיות. אלא כשהמדובר הוא בקבוצה, בעם, מיד משתנה הדבר,  אומרים: עם חי למען עצמו. אני שולל את הדבר הזה הקטע הנפלא הזה לקוח מתוך אוסף מאמרים של תקווה לשעה זו, הוצאת עם עובד, שיצא לאור בקטע זה שני עניינים מרכזיים שתפסו את תשומת ליבי.\r\nהראשון הוא בעצם הסיטואציה שבה מכנס ראש הממשלה דאז, דוד בן, אנשי רוח כדי לדון בשאלות השעה הקשורות להתפתחותה של מדינת ישראל. בהקשר זה פותח מרטין בובר את הפגישה בדברי ברכה לראש הממשלה, שנותן מקום לאנשי הרוח להשפיע על ענייניי המדינה. בכך הוא ממשיך מסורת מפוארת מאפלטון שדיבר על הצורך שיהיה הפוליטיקאי איש רוח-פילוסוף, החל שהיה דוגמה בחייו למצביא, מדינאי ופילוסוף, וכלה  שביקש שאם לא יוכל הפילוסוף להיות השליט, לכל הפחות שתהיה ההזדמנות שקולו יישמע. הברכות לדוד בן ניתנות בדיוק בהקשר הזה כשהחיבור בין ניהול המדינה לחוכמה ולרוח נשתכח במהלך ההיסטוריה, והנה ניסיון אחד לחבר שוב. כאן כאמור יש נקודת פליאה וכבוד לעצם ההתרחשות.\r\nנסו לחשוב על השדה הפוליטי של ימינו, על האינטרסים והכוחות המעצבים אותו, על דרכי הפעולה, על הערכים או חסרונם… וראו כמה הרחקנו מהניסיון לחבר את אמנות השלטון עם הרוח והמשמעות.\r\nמעבר לכך השאלה הפשוטה והנוקבת שמעלה אדמת יהודים לשם מה? ורצף השיח הקצר בינו לבין בן שמשיב בצורה פרקטית ועניינית מאוד, מעלה על נס את אחת הסוגיות החשובות ביותר שיש בחיים של אומה בדיוק כפי שהיא מתקיימת בחיים של יחיד, כפי שמעיד על כך באופן נחרץ חיים לשם מה?\r\nהתשובה שנותן לשאלה זאת, הן ברמת היחיד והן ברמת המדינה, היא חד משמעית וברורה; אין חיים סתם לשם חיים. צריכים היחידים וצריכה הקבוצה לתת משמעות ומהות לחיים שהם מעבר לחיים לשם חיים.\r\nמהם החיים לשם חיים? אולי מה שאנו מכנים לעיתים קרובות חיי ההישרדות, חיים שהם סך המאמצים שלנו כדי להשיג את האמצעים הנדרשים בחיים כדי להמשיך ולקיים את האמצעים.\r\nשאלת משמעות החיים היא שאלה כבדת משקל שנשאלה מאז שחר היות האדם.\r\nיש הרואים בשאלה זאת שאלה פילוסופית מתפלספת… שאינה באמת קשורה לחיים, אבל יש גם רבים שהתעסקו בשאלה זאת מתוך דחף וצורך אמיתי של חיים, ולא רק כסוגיה אינטלקטואלית.\r\nתהיה אשר תהיה התשובה לשאלה מה משמעות החיים, נדמה שחיים שנחיים ללא עצירה ובחינה של משמעותם ומטרתם, לא שונים במהותם מחיי בהמה המשוטטת במרחבי העשב ומלחכת להנאתה ככל שהיצרים שלה מבקשים.\r\nהאם האדם משול לבהמה?\r\nתשובתו של קהלת לשאלה זאת היא שאין הבדל בן האדם לבהמה. כלומר הם בבחינת מקרה אחד.\r\nאולם תשובות רבות אחרות לשאלה עקרונית זאת מצביעות על ההבדל המהותי בין האדם לבהמה, הבדל שנעוץ ביכולת של האדם לבחור לפעול עם הכרה ותשומת לב על פי ערכים ואמונות שלו, ולא רק מתוך מנגנון אוטומטי משוכלל של יצרים.\r\nאכן יש באדם חלקים שיכולים להיות מופעלים באופן מכאני וללא בחירה, ויתכן שאת מרבית זמנו מבלה האדם על פני האדמה בליחוך העשבים. אולם יש באדם גם ממדים גבוהים יותר. יש לו יכולת הכרת עצמו והעולם בממדים העדינים, הנסתרים מן העין, הרוחניים, והבחירה נתונה בידו כיצד לחיות וכיצד לפעול.\r\nכך בהתאמה לתשובתו של היחיד על משמעות החיים, ניתנת תשובתו לשאלה: מדינה לשם מה?\r\nברור שאם אנו תופסים את החיים כדבר שיש לחיותו לשם עצמו… כלומר מטרת החיים בעצם קיומם במישורים הבסיסיים הנראים, אזי המדינה והחברה שאנו נקים ישימו להן למטרה לסייע לאדם למלא את צורכי החיים הבסיסיים שלו – ביטחון בסיסי והוצאת אוכל מן האדמה.\r\nאבל אם אנו מכירים בצורך של היחיד לחיות את החיים שהם מעבר להישרדות הבסיסית הפיזית, שהם מעבר לקיום האמצעים, שיש בהם שאיפה להכיר ולממש ערכים ואידיאלים רוחניים – אזי החברה או המדינה שנקים תהיה מכוונת בבסיסה ובשורשה להיות מנגנון שיסייע לאדם לאורך כל חייו לחיות יותר ויותר.\r\nשלא כפי שאנו נוטים לעיתים לחשוב ולהתנהל בעולם, קביעת המטרה והחיבור לצורך קודמים למציאת האמצעים.\r\nחיי היחיד וחיי החברה יש להם כשורש את המטרה הגבוהה ביותר שאליה מכוונים החיים, והאמצעים שמוצא היחיד או הקבוצה קשורים ישירות לגודלה ועומקה של המטרה.\r\nמצא מטרה, והאמצעים כבר יימצאו\r\nאם כך, מדינה לשם מה?\r\nאם אנו מבקשים לקיים מדינה רק כדי להוציא את האוכל מן האדמה, נקבל מסגרת שתצליח לעשות זאת זמן מה, אבל היא תושפע במהירות יחסית [ומהירות יחסית במונחים היסטוריים יכולה להיות בת עשרות שנים מאינטרסים וזרמים אחרים שקיימים בחומר. למשל מיחסי כוחות הקשורים לחלוקת האוכל, מאינטרסים אגואיסטים ופרטיים של חברים בחברה ועוד.\r\nמוכר?\r\nאבל אם אנו מבקשים לקיים מדינה שיש לה כמטרה את הרצון לחיות חיים ערכיים, את השאיפה להיות מסגרת המבקשת לסייע ליחיד לחיות חיים בעלי משמעות, חיים שהם מעבר להזדהות עם החומר וכל הצעותיו – אזי יש לנו אופק של חיים, של אתגרים וצמיחה אפשרית, רחוקים, גבוהים ועמוקים פי כמה וכמה.\r\nשהיה משחררה הגדול של הודו, ביקש למעשה לא רק לשחרר את ההודים מכבלי השלטון האנגלי, אלא ביקש לקדם תהליך מתמשך של שחרור הודו ובניה מהכבלים השונים, גם ברמות העדינות יותר והפחות נראות. הוא ביקש לקיים הודו שתצליח לסייע לאזרחיה להיות משוחררים מכבלי עצמם, כבלי האגו שלהם, כבלי האינסטינקטים וההפרדה, ובהתאמה לכך חלם על הודו אחת למוסלמים ולאחרים. \r\nמתוך תפיסתו זאת הגדיר שבעת החטאים החברתיים הם: פוליטיקה ללא עקרונות, עושר ללא עבודה, תענוגות ללא מודעות, ידע ללא אופי, מסחר ללא מוסר, מדע ללא אנושיות וסגידה ללא הקרבה מתוך רשימה הסוגרת מאמר בכתב העת הודו הצעירה באוקטובר\r\nמה יש בבסיס החטאים החברתיים הללו? אלו הם אמצעים שאינם משרתים מטרה נעלה; אמצעים שהופכים להיות המטרה.\r\nבעידן שאנו חיים בו, בפינות שונות בכדור הארץ עולה ונשמעת צעקת האנשים הדורשת צדק חברתי. צעקה שפורצת גבולות פיזיים ותרבותיים. יתכן שהגיע הזמן לשאול את עצמנו שוב למה אנו חיים את החיים כיחידים ומה מטרת החברות והמדינות שהקמנו.\r\nיתכן שנראה שאנו נכשלים בקביעת המטרה, שאנו מכוונים אל הארץ והחומר… שהאידיאל שאותו אנו מבקשים לקיים אינו רחב מספיק, חסר הוא, ולכן החיים הקולקטיביים כמו חיינו האינדיבידואלים חסרים בצדק, ביופי, בטוב, באמת…\r\nאיך מתקנים זאת? קצרה היריעה כדי להסביר זאת כאן, אולם נראה שגם כאן עצתו של תקפה היה השינוי שאתה רוצה לראות בעולם\r\nיש צורך להתחיל את השינוי מהיחיד. היחיד הוא האבן שעמה בונים את החברה וממנה יוצרים את ההיסטוריה האנושית, ולמרות שלימדו אותנו בעולם החומר כי השפעתו האפשרית של היחיד בעולם של המונים קטנה, אנו יודעים שאין זאת כך.\r\nאנו צריכים כאן ועכשיו אנשים המבקשים בחייהם לחיות את החיים לא סתם כך, ומשום כך לא יסכימו שחיי החברה שהם חלק ממנה יהיו מכוונים רק כדי לאפשר את החיים סתם כך.\r\nככל שיהיו יותר אנשים המבקשים לחיות ולא רק לשרוד, החברות שבהן אנו חיים ילכו ויתעצבו בהתאם.\r\nלסיום, אם נחזור למדינת היהודים… לשם מה נבנתה מדינה ליהודים? \r\nנדמה שתשובתו של דוד ניצחה ובמהלך השנים נבנה בית ומקלט פיזי לכל היהודים המבקשים להיות חלק מבית זה, ולא רק נבנה הבית אלא גם נמצא בו אוכל.\r\nאבל רק שישים שנה עברו וכבר לא ברור האם זה אכן מספיק, ובעיקר מהו האופק של חברתנו וכמה רחב הוא.\r\nעכשיו, כמו בכל העולם, עולים קולות המבקשים חלוקה אחרת של המשאבים… עולים שאלות וספקות לגבי הזהות והמשמעות של החברה הישראלית. יש יותר ויותר חלקים שלא רואים עוד בחברה זאת בית. יש שאלה גדולה לאן נמשיך וכיצד.\r\nגם אנו, ככל אומות העולם, צריכים להתמודד עם השאלה הנוקבת שאחד ממנסחיה בהיסטוריה היה הוגה הדעות היהודי מרטין בובר – מדינה לשם מה? \r\nודומה שאנו מבינים שהתשובה לשם אוכל כבר אינה מספיקה. יש בפינו אוכל ואנו עדיין חסרים.\r\nמדינה לשם מה? יענה כל אחד ואחת מאיתנו… נענה כולנו!\r\nשלכם,\r\nלכל יצור חי על הפלנטה שלנו יש תפקיד בשמירה על האיזון העדין של המערכת האקולוגית. אם אחד מהם לא יבצע את תפקידו, יופר האיזון וישפיע על השלם. היום, כאשר אנו מסתכלים על הפלנטה שלנו ועל ההרס שאנו גורמים לה, אנו מגיבים בדרך כלל רגשית: בכעס, בתסכול, בייאוש ובחוסר אונים נגד כוח גדול לכאורה, שמעבר לשליטתנו. הרגש יוצר תגובה, רצון לעשות משהו בקשר לזה. רצון זה ילך איתנו עד שיעלם כי עניין אישי אחר יתפוס את מקומו. בסופו של דבר זה יוביל אותנו למסקנה שיש לקבל את הדברים כפי שהם, ולהתמודד עם מציאות זו כחלק מהחיים.\r\nהמשבר הסביבתי נתפס כאוסף של בעיות גלובליות ואזוריות שנגרמות על ידי ציבור אנונימי. והפתרון, כך חושבים לעיתים קרובות, צריך לבוא מהם. לעיתים רחוקות מאוד אנחנו באמת פוסעים אחורה וחושבים על התפקיד שלנו כפרטים בהקשר החברתי או בהקשר לסביבה שלנו. לעיתים רחוקות אנו מזכירים לעצמנו כי ציבור אנונימי זה מורכב מאנשים כמוני וכמוך. בין נקבל זאת ובין לאו, כל אחד מאיתנו תורם לשימוש הלא אקולוגי במשאבים הטבעיים הזמינים על הפלנטה שלנו. לפיכך, לפני הכול, כל שינוי שאנו רוצים לראות צריך לבוא מתוכנו.\r\nפעולה אקולוגית היום היא בדרך כלל תגובה למחסור במשאבים זמינים לצריכה של הפרט היום, או בעתיד. הפתרונות לטווח קצר הם לעיתים קרובות רק טיפול סימפטומטי, מבלי שנגיע לשורש הבעיה. אני מציע בצניעות, כצעד ראשון פשוט, שנהיה מודעים קצת יותר לדפוסי הצריכה שלנו.\r\nהנה תרגיל קטן שכדאי לנסותו: קנו חבילה של עוגיות בחנות סמוכה, מהסוג שאתם אוהבים או אהבתם כילדים, וקחו לכם פסק זמן של שקט. פתחו את חפיסת העוגיות ואכלו אחת או שתיים. התענגו על הטעם, המרקם המתפורר, הארומה, והעלו זיכרונות מהעבר על הנאתכם מעוגייה זו. חשבו מדוע עוגייה זו אהובה עליכם. ועכשיו, כשאתם נהנים מעוגייה נוספת, הפכו את החפיסה והסתכלו על רשימת המרכיבים שלה. בדרך כלל אנו עושים זאת כדי לבדוק את כמות הסוכר, השומן והקלוריות. בואו ננסה לא להתמקד ברכיבים הבריאותיים לכאורה של העוגייה לרגע כדי שהנאתנו לא תיפגע. הסתכלו על רשימת החומרים המרכיבים את העוגייה וחשבו על השינוע של כל אחד מהם. יש לקוות שיש ברשימה כמה מוצרים טבעיים. נתחיל בהם. היכן גודלו? באיזה מפעל עורבבו החומרים? מהו המרחק שנדרש כדי להעבירם לחנות שממנה קניתם את העוגיות?\r\nקילומטר מזון הוא מושג המתייחס למרחק שכל פריט במוצר עובר במסעו מהיצרן לצרכן. המושג משמש כיחידת מדידה של הדלק הנצרך במהלך מחזור חיים של כל פריט.\r\nבואו נתחיל עם הדגן, שהוא בדרך כלל חיטה בצורת קמח. אם הוא מיוצר בהודו, החיטה מגיעה בדרך כלל מחוות בצפון, סביב. חשבו על האיכר ומשפחתו שזרעו את הזרעים, על השוורים או הטרקטור שחרשו את השדה, על המאמץ שהושקע בהשקיה, על השמש שזרחה ושהביאה להבשלת גרגרי הזהב של החיטה. חשבו על תהליך הקציר, על הדיש שמפריד את החיטה מהמוץ, על איסוף החיטה לשקים ושינועם מהחווה לשוק המקומי. שם הם נמכרים ומובלים יחד עם עוד מאות שקים כאלה, ממאות חוות אחרות, אל סף המפעל שבו מיוצרת העוגייה.\r\nנעצור לרגע של הכרת תודה לחקלאים על גידול הדגן.\r\nעד כה דיברנו רק על הקמח. חשבו על מרכיבים טבעיים נוספים בעוגיות. הסוכר גדל הדרומית. הקקאו צומח באפריקה או בדרום אמריקה. אגוזים באים מקליפורניה, טורקיה או קשמיר, פקיסטן או אפגניסטן. כל מרכיב עובר תהליך של גידול, איסוף, עיבוד ושינוע.\r\nנחזור למפעל שבו רוכזו כל החומרים, מסודרים בקפידה, מוכנים לשלב של עיבוד הבצק. חשבו על פועלי המפעל שנשאו את השקים הגדולים ורוקנו אותם אל התערובות התעשייתיות, וגם על מפעילי המכונות המשגיחים שכל המרכיבים הוספו בכמויות הנדרשות. חשבו לרגע על האנשים המעורבים בתכנון הייצור באמצעות מכונות, ללא מגע יד אדם. אותן מכונות מסוגלות לערבב בדיוק ולשכפל עוגיות זהות. אחר כך חשבו על האש שאפתה הכול לשלמות פריכה ועל תהליך האריזה שעטף יפה ובצורה מסודרת את העוגייה הקטנה, כמו זו שאתם מחזיקים בידכם כעת, ולאחר מכן לתוך קרטונים גדולים יותר כדי להישלח לחנויות ברחבי הארץ.\r\nנוסף על כך, שִקלו בכל שלב את צריכת הדלק והחשמל ואת התשתיות. כל השימוש העצום הזה במשאבים נעשה רק כדי להבטיח שנוכל ללכת אל המכולת השכונתית, למצוא את חפיסת העוגיות האהובה עלינו ושיהיה לה טעם זהה בכל פעם שנפתח את עטיפת הפלסטיק. שקלו גם את מערכות סילוק האשפה הנדרשות עבור עטיפות הפלסטיק: משאיות האשפה, הפרדת העטיפות למחזור, המטמנות…  \r\nורק כדי שיהיה ברור, חשבו על כך שאנחנו כמיליארד בני אדם על הפלנטה, וכל אחד מאיתנו רוכש אלפי פריטים שונים במהלך חייו: מזון, בגדים, אלקטרוניקה. אנחנו כבר צורכים יותר משאבי טבע משכדור הארץ יכול לחדש. \r\nאם האוכלוסייה תגיע מיליארד עד הקרן העולמית לשימור חיות הבר מזהירה שננצל כבר משאבים ביולוגיים בכמות של שני כדורי-ארץ. המחסור במשאבים טבעיים כבר יוצר סבל בפלנטה שלנו.\r\nכמיליון אנשים ברחבי העולם אין די מזון. אך לא זו הבעיה: קיים בזבוז עצום של משאבים מנקודת הייצור ועד לצריכה. עודפים גדולים של דגן נרקבים במחסנים בחלק אחד של העולם, בעוד אלפים מתים מרעב בחלקו האחר העניים ביותר צורכים רק ממשאבי העולם, בעוד העשירים ביותר צורכים  מהם. למעשה אפשר לצמצם לכמחצית את השימוש במשאבים ואת הזיהום אם  מיליון העשירים בעולם  יבחרו לחיות ברמת חיים ממוצעת. מהאוכלוסייה אחראים מצריכת המשאבים הטבעיים; אינני סבור שעלינו ללכת רחוק כדי להציל את הפלנטה שלנו.\r\nאמר פעם, יש בכדור הארץ מספיק כדי לספק את כל צורכי האנושות, אך אין מספיק כדי לספק את חמדנותו של אדם אחד\r\nאם נהיה מודעים יותר לצריכה שלנו כפרטים וכחברה נוכל אולי להקל על המחסור במשאבים ולשלוט בהרס שאנו גורמים לכוכב הלכת שלנו.\r\nמהיכן נתחיל? מהדברים הקטנים שאנו צורכים מדי יום; האוכל שאנו אוכלים, הבגדים שאנו לובשים, חומרי הניקיון שבהם אנו משתמשים, הזבל שאנו מפיקים, הדרך שבה אנו נוסעים לעבודה. בכל אחד מאלה אפשר לצמצם את העקבות שאנו מותירים על הסביבה שלנו. ככל שנהיה מודעים יותר, צנועים יותר ומחוברים לרשת החיים שלתוכה אנחנו ארוגים, במקום להיות טפיל שרק לוקח ואינו מתחשב במארח – אולי נוכל להפוך למטפחיה של הפלנטה הזו.\r\nלדעתי מטרת האדם היא ליצור הרמוניה עם הטבע ולעבוד ואיתו, במקום לשבור את החוקים שלו. זהו תפקיד של תמיכה ואחריות ולא של הרס וניצול, ואולי כאן טמון אחד הסודות העמוקים לאושר שלנו ולאבולוציה שלנו כבני אדם.\r\nאיפה אפשר לבטא כאב מבלי להיות חשוף לסכנה? ומה יכול להיות מסוכן למי שמבטא כאב? לעתים חדר שירותים לנשים בלבד הוא מרחב בטוח שאפשר להיות בו אותנטי, לחלוק כאב ולבקש עצה. סיפור אמיתי\r\nחדר השירותים במשרד שאני עובדת בו חנוק ונעדר חלונות. אם מישהי נעמדת שם כדי לדבר עם מישהי, וזה קורה לפעמים, הרי זה משום שזהו מקום אינטימי וסגור לכאורה המאפשר חילופי דברים שלא רוצים לומר במשרדים או בפרוזדור.\r\nבמקום הסגור והחנוק הזה יש שישה תאים, וכל אחד מהם עשוי להיות מלא כאשר שתיים עומדות ומשתפות זו את זו במשהו אישי. אם לא רואים את מי שנמצאת בתוך תא ואם לא מתעמקים בזה, יכולה להיווצר אשליה של פרטיות. לעיתים הדוברת המיוסרת לא מתעניינת אם התאים מלאים או ריקים, משום שיש לה דבר מה להסיר מעל ליבה. מבחינתה, זהו המקום הכי פרטי שניתן להשיג בקומה, מאחר שזהו חדר לנשים בלבד, לפחות פרטי מפני גברים.\r\nכזה היה המקרה בשבוע שעבר. כשנכנסתי פנימה לאייש לרגע את אחד התאים, עמדו ליד הכיורים שתי נשים דתיות. האחת, בעיניים לחות, שיתפה את חברתה במצוקה שהיא חשה בעבודתה. הבוס, כך היא כינתה אותו, לא מרוצה משום דבר שהיא עושה. על כל דבר יש לו טענה, ויש לה תחושה שככל שהיא מתאמצת היא לא מצליחה לענות על ציפיותיו. ניכר מדבריה גם שהציפיות לא ברורות לה ושמצוקתה נובעת מכך שאין לה מושג מה היא עוד יכולה לעשות כדי להיות מקובלת עליו, יעילה ומוצלחת.\r\nלא התכוונתי להאזין, אבל לא הייתה כל אפשרות אחרת. קולה הדהד בין הקירות האטומים אף שלא הרימה קולה. היא הייתה מיואשת. ברגעים אלה נזכרתי בשנים עברו, כשגם לי היו רגעים כאלה של חוסר התאמה – אם ביני לבין עצמי, ואם ביני לבין ממונה או שותפה למשימה. לא תמיד קל להניח את האצבע בדיוק על חוסר ההתאמה. אולי ניתן לתאר זאת כמפגש בין זרים שאין להם שפה משותפת וכל אחד נוטר לאחר על כך שאיננו מובן. השפה האחרת הזו יכולה להיות מזג שונה, ערכים שונים, הרגלים ועוד. כל זאת מבלי לכלול אפשרות של מה שמכנים בשם גנאי פוליטיקה מקומית שאין לה כל קשר לפוליטיקה במובן הפילוסופי.\r\nהגעתי כבר לנטילת ידיים, ואני לידן. הדוברת נתנה בי מבט אחד והחליטה, כנראה, שאני לא מזיקה וכאן הגיעה אל הנקודה הכואבת ביותר מבחינתה. את לא תאמיני מה הוא שאל אותי הבוקר אמרה לחברתה, והוא עוד עובד סוציאלי. אני לא מבינה, איך הוא יכול? איך אפשר לשאול מישהו דבר כזה? הוא שאל אותי מהו הערך המוסף שאני מביאה לעבודה? מה אני אמורה לענות על דבר כזה? חברתה, כשהייתה שקטה ומכילה עד כה, התמתחה לרגע, מבטה נע לצדדים בחיפוש אחר תשובה הולמת, ומשלא מצאה כזו השיבה לבסוף, את יכולה להזכיר לו שהכנת… וארגנת… היא מנתה כמה משימות יומיומיות ספציפיות. הדוברת שתקה והתבוננה בה בעיניים ריקות. הייתי בדרכי החוצה וכבר הושטתי יד אל הדלת כשחשתי בתוכי, שאף שהשיחה פרטית בין שתיים שאיני מכירה, יש כאן הזדמנות לתת משהו. זהו רגע מביך. שתיים מדברות באינטימיות, והאינטימיות מתאפשרת לשתיהן מפני שהן במרחב לנשים בלבד ומפני שהן ראו אותי והחליטו שאינני גורם מאיים, ולפיכך קיומי אינו מערער על האינטימיות שלהן. אם אני בוחרת להשתתף, אני מנפצת בועה כלשהי ומכריזה בזאת לא רק על נוכחותי ברגע, אלא על כך שהקשבתי לכל השיחה. האם זה לגיטימי? האם אתי? אולי נכון יותר לכבד את הבועה ולהסתלק בשקט?\r\nבחרתי להתערב כי תשובת החברה לא הניחה את דעתי, ונראה היה לי שגם לא את דעת הדוברת.\r\nסליחה ביקשתי, שאני מתפרצת לדלת פתוחה. לא יכולתי שלא לשמוע את שיחתכן, ואם אתן מרשות, יש לי עצה.\r\nהן קידמו אותי בברכה, בבקשה, בבקשה הן אמרו, ולפתע יכולתי לראות בסיטואציה משהו אחר לגמרי. לא שהן ביקשו שאתעלם מהנשמע ואכבד את הבועה, אלא אולי קיוו שתימצא מישהי, רחוקה מהנסיבות, שתוכל להגיב.\r\nמדהים אילו נדודים אפשר לעבור בשברירי שניות, ואני נדדתי לגיל שמונה עשרה, לפני הגיוס, כשניסיתי לעבוד כפקידה במשרד פרסום ואחר כך במשרד עורכי דין, וזה היה כישלון. אחרי הצבא ניסיתי פעם שלישית במשרדים של חברת ביטוח גדולה. כישלון למה שלא תלכי ללמוד משהו? אמרה לי אז אחת הממונות, לא מתאימה לך העבודה הזו  ועדיין ראיתי בכך עלבון וכישלון, והחוויה הייתה צורבת. ערך העבודה היה ערך עליון בבית הוריי, וכבר בראשית הדרך נכשלתי. ולא ידעתי אז מה הערך המוסף שלי, מה אני מביאה למקום העבודה שהוא בכל זאת שווה משהו. אבל כבר שנים רבות אני יודעת, ומאחר שאני יודעת, משתכלל הערך המוסף שלי עוד ועוד, כמו אצל כל אדם שיודע. בפעם הבאה שמישהו ישאל אותך מה הערך המוסף שאת מביאה,  תגידי – את האיכות האנושית שלי. הערך המוסף שלך אף פעם לא מסתכם ברשימת משימות שביצעת אמרתי. עיניה של הדוברת זהרו. שתיהן התבוננו בי בריכוז רב וחשתי שליבן פתוח. כשם שהיו נכונות לקבל התערבות בלתי צפויה, הן היו נכונות להקשיב ולקבל.\r\nהן היו אסירות תודה. לא שאלו אותי אף שאלה, ורק אמרו שנכנסתי בדיוק בזמן. שיחתן הסתיימה והן יצאו עם תובנה אחרת, גם אם עדיין לא עם כלים שלמים להתמודדות בהמשך. אני, במידה מסוימת, קיבלתי עוד הזדמנות לומר את זה למי שהייתי אז, לפני שנים, לזו שחוותה חוסר התאמה ולא הבינה למה ואיך יוצאים מזה. ואני מאמינה שאם אדם מקבל הזדמנות להגדיר את הערך המוסף שלו, יש לו מידה רבה יותר של כוח לחפש אחר מקום אחר, מתאים יותר למהותו הפנימית.\r\n נקודת מפנה היא הנקודה בה העלילה מקבלת תפנית ומה שארע עד אותו הרגע משתנה.\r\nעל נקודות מפנה בחיים ועל מהפיכות קטנות-גדולות, מנקודת מבט אישית ופילוסופית של אמא טרייה.\r\nהשנה הזו הייתה מהפכנית עבורי – הפכתי להיות אימא, וזה שינה כל כך הרבה דברים בחיים שלי.\r\nמהמקום שבו שלטתי בזמן שלי באופן מוחלט והחלטתי בין מה למה לחלק אותו, נוצר המקום שבו יש צרכים של עוד שתי ישויות (כן, שתיים..) שקודמים לכול!\r\nזה מובן וברור שזה מה שצריך להיות, לפחות בהתחלה, רק שבאופן טבעי זה דרש זמן הסתגלות.\r\nבתחילה נראו הימים כמו סרט נע; רצף של האכילות, החתלות, רחצות וחוזר חלילה.\r\nמובן שנכחה השמחה על המצב החדש, אבל נלוו אליה הרבה מצבים כמעט בלתי אפשריים שטמנו בחובם התמודדויות רגשיות לא פשוטות. ובתוך כל הרצף הזה נכח איזשהו כוח מניע. אחרי התקופה הראשונית, כשהדברים התחילו להתאזן, תהיתי מה הוא אותו כוח.\r\nהאם תמיד היה שם בתוכי וברגע הנכון פרץ החוצה? האם לאורך הדרך שהספקתי לעשות עד כה הצלחתי לייצר אותו, לחזק אותו?\r\nעם המחשבות הגיעה התובנה שבעצם המהפכה התחילה אצלי מזמן. \r\nהיו לה שלבים מוקדמים שכללו מגוון של התנסויות, בחירות והחלטות אמיצות ומן הסתם גם פחות אמיצות. לאורכם של שלבים אלו תמיד היו נוכחים החיפוש אחר משמעות, אחר תשובות לשאלות הגדולות של החיים, וכן שאיפה ומאמץ להגיע למקום שארגיש שאני ממלאת בו ייעוד מסוים – הייעוד שלי!\r\nאחד השלבים הראשונים כלל בתוכו מסעות לאפריקה והתנדבות עם בעלי חיים (קופים בעיקר, מעניין שהרבה מהחוויה האימהית הזכירה לי התנסויות מהחוויה האימהית הראשונה שלי עם תינוק שימפנזה בשם גורן, אבל זה כבר נושא לכתבה אחרת. \r\nבהמשך חל שינוי בדרך המקצועית שלי והשלב האחרון כלל את הבחירה באימהות.\r\nזה לא היה מובן מאליו הפעם. אני כותבת הפעם, כי בעבר לא הייתה שם שאלה בכלל מבחינתי.  \r\nהיה לי ברור, כמו להרבה אנשים, שהחיים יתנהלו במסלול המקובל: צבא, טיול, תואר, עבודה, משפחה. אבל ליקום הייתה כנראה תוכנית אחרת עבורי, ואז כבר שום דבר לא היה לי ברור מאליו.\r\nבנקודת זמן רגעית שבה היה נראה שהחיים שוב חזרו למסלול פגשתי את לימודי הפילוסופיה.\r\nהחיים קיבלו משמעות שהתבססה בעיקר על מחקר מתמיד, לימודי פילוסופיה כדרך חיים ושיתוף של המתנה שקיבלתי הלאה. למה הכוונה? \r\nיש מושג בתרבות המצרית שנקרא  הכוונה לצדק על פי מהות, בשני מובנים – לעשות את מה שנכון וצודק עבור המהות שלי; לחיות את הייעוד שלי. ובהיבט נוסף – מה שאני מקבלת ומה שכבר נמצא בתוכי, מן הצדק הוא שאעביר אותו הלאה, אחלוק אותו עם העולם. לא דווקא בדרך של לימוד או הרצאה, אלא יותר בדרך של עשייה והוויה. ויש הרבה מה לעשות!\r\nכחלק מהמהפך הפכתי מאדריכלית למורה. לפני כן לא היה לי כל כך הרבה מגע עם עולם הילדות. קצת דרך האחיינים שלי וזהו.\r\nהעיסוק בהוראה התחבר אצלי לצדק במובן של העברה הלאה; נתינה. זוהי דרך אחת מני רבות שבה זיהיתי את האפשרות לחלוק ולשתף – בהתאמה כמובן לגיל הצעיר – את מה שכבר הבנתי שבאמת חשוב בחיים. המחשבה על יצירת תא משפחתי נראתה לעתים כצמצום של כל אלו. האם אלו שני דברים שונים? חינוך של ילדים בכיתה וחינוך של ילדים בבית? בבית קיים הממד האישי, הביתי, האינטימי, שהבנתי שכנראה לא ארצה לוותר עליו.\r\nככל שחקרתי לעומק את החיים שלי, ואת החיים בכלל, עלו עוד דברים חשובים שלא הייתי בטוחה שיעלו בקנה אחד עם להיות אימא. כן, זה הגיע למחשבות על זה שיש יותר מדי מאיתנו על כדור הארץ, שהכדור הוא לא מה שהיה פעם, ועוד. לכל הלבטים היה שותף גם בן זוגי היקר, מה שהוסיף בהכרח מורכבות למצב.\r\nבד בבד עם ההתחבטות ואינסוף השיקולים לכאן ולכאן, גבר איזשהו רצון פנימי.\r\nאני זוכרת שבדרך להורות נהגתי לערוך הסכמים ביני לביני – הבטחתי לאהוב את התלמידים שלי כפי שאוהב את התינוק שיגיע. הייתה הבנה ושאיפה שאם, וכאשר, יהיו לי ילדים משלי, אשתדל בכל כוחי להמשיך להיות בעשייה שנמצאתי בה, בערוצים שמצאתי לנתינה, ערוצים שונים שמתחברים לדרך חיים פילוסופית אחת.\r\nברור שזה לא פשוט. נוכחתי לדעת שזה ממש מאתגר, במיוחד כשהגיעו שתיים \r\nנדרשה תקופת הסתגלות ארוכה כדי להתחיל להרים את הראש מעל המים ולחדש דברים שהוקפאו במעין תקופת המתנה.\r\nברגעים לא פשוטים וגם בהרבה רגעים פשוטים – אבל כאלו שמצאתי את עצמי בתוכם ברמות עייפות מתקדמות – זכרתי (וגם היה מי שהזכיר לי) את הספר הקטן שדאגתי לקרוא עוד לפני הלידה החינוך מתחיל לפני הלידה\r\nהרבה מאיתנו נתקלו באִמרה שכדי להוציא רישיון נהיגה צריך ללמוד ולעבור מבחן, אבל כדי להיות הורה, לא נדרש מאיתנו מאום. בספרו מתייחס, פילוסוף ומורה רוחני, למחויבות של האנשים לעבור הכנה מעמיקה לפני שהם הופכים להיות הורים.\r\nהוא מציין עד כמה מצבן הפנימי של האימהות משמעותי לעיצוב הילד שהן נושאות ברחמן, ועד כמה חשוב שהאישה תמלא את ראשה במחשבות קורנות ומוארות, אשר הודות להן תספוג הישות שבתוכה יום יום את החומרים הטהורים הללו, ובבוא היום היא תלד אומן, מלומד או אף אדם מקודש.\r\nאומר שכל הטיפול וההקרבה העצמית של האימהות אינם מספיקים ותמיד צריך לצרף עוד חלקיקים, כוחות ועוצמות שמיימיים.\r\nמהם אותם חלקיקים ועוצמות? טוען שאסור לנו לנטוש את השמיים עבור אף אחד, גם לא עבור ילד. רק אם נישאר בשמיים, במובן הסמלי, כלומר נשמור על הקשר עם הרוח, נוכל להשפיע לטובה על סביבתנו. לשם כך נדרש האומץ להתרחק לזמן מה כדי להיות בעולם האלוקי. שם נצבור את השפע, שבו לאחר מכן יוכלו לטבול כל מי שהותרנו מאחור, כולל אנו עצמנו.\r\nולכמה זמן להתרחק? תהיה מי שתתרחק לשעה, ליום, לשלושה חודשים.\r\nעל פי אפילו שהייה של לפחות עשר דקות, חצי שעה, יכולה להשפיע. כל זמן שניתק הקשר עם המרחבים העליונים ולא ניתן למשוך מהם חלקיקי אור, טוהר ונצח – כל הדברים שהאם תיתן לילד יהיו נדושים ולא יסייעו לו להגשים את הנפלאות שיועד להן.\r\nבמהלך השטף יומיומי, ההישרדותי, קשה לדמיין עשייה שהיא מעבר לכל מה שנדרש באופן בסיסי כדי לצלוח את היום. \r\nבסוף היום, כשהבית שקט וכמעט כל המשימות הושלמו, נדרשים כוחות אדירים כדי להתגייס לעשייה מן הסוג העדין שנוגע ברוח.\r\nבמיוחד כשהמיטה קוראת (בקולי קולות), או כשהראש מבקש זמן בהייה עם הסיבה המוצדקת של מנוחה. ועם כל אלו קיימת הידיעה הברורה שאפילו עשר דקות של קריאה (לא של מיילים) – כל דבר שישמור על החוט, על החיבור לעולם של הרוח – יהיה משמעותי ויאפשר לנו לתת הלאה. \r\nהרי לא נוכל לתת את מה שאין בתוכנו.\r\nהפליא לתאר זאת החולם אחר השמש\r\nבשבילי, המחנכת הגדולה ביותר היא השמש. כן, היא המורה שלי. היא אמרה לי: תאמין לי, כל אלה שמעידים על עצמם שהם מחנכים, אינם מכירים את החינוך האמיתי. הם לא יודעים שבשביל לחמם אחרים, עלינו להיות חמים בעצמנו, שבשביל להאיר אחרים, עלינו להיות מוארים בעצמנו, שבשביל לחיות אחרים עלינו להיות חיים בעצמנו\r\nכמו כל אימא טובה, אומר שבשביל לעבוד צריך כוח ובשביל כוח צריך לאכול, ואז מעלה את השאלה האמיתית – מדוע איננו מבינים שאותו חוק חל על הממד הרוחני?\r\nעלינו לחפש מזון רוחני טרי ומלא חיות, ולספוג אותו כמו את קרני השמש בבוקר.\r\nאנו זקוקים למזון טהור שנובע מהמעיין, מזון שהוא כמו החיים עצמם: פשוט, רב עוצמה, מאיר, מרווה, מחיה\r\nמובן שהעצות המופלאות הללו מתאימות לכל אדם באשר הוא. לכל אחד יש למי לתת, ולו משהו מעצמו. אין הכרח להיות מורה, מחנך, הורה. בעצם כל אחד מאיתנו הוא קצת מכל אלו.\r\nכל יום טומן בחובו אינספור הזדמנויות לנתינה, להעברה הלאה של מי שאנחנו. לקופאי בסופר, לשכן, לילד שלנו… ואת הדבר הזה לא נוכל ליילד מעצמנו אם לא נטפח בתוכנו את הקרקע הפורייה שממנה יצמחו החיים הפשוטים ורבי העוצמה!\r\nאבל איך בכל זאת עושים את זה? זוכרים?! סוף היום , הגוף נמצא בהתשה והמוח מרוקן מכל מחשבה, למעט כמיהה לכרית הנכספת.\r\nעבורי, מה שעושה את ההבדל וגורם לי להצליח להתרומם זה קצה החוט שאני מקפידה לא לאבד. לא תמיד זה מצליח לי; המאבק הוא יומיומי. לפעמים ההצלחה היא פשוט לא לשמוט אותו, ולפעמים למשוך אותו אליי עוד ועוד, קרוב יותר ויותר,  ולהצליח לרקום ממנו משהו, קטן ככל שיהיה, הוא יצטרף לעוד רקמה מהיום הקודם ולזו שמחכה לו בהמשך הדרך");
